// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

contract CryptoSavingBank {
  address public owner;
  mapping (address => uint) public cuenta;

  event ingresar (address reminente, uint cantidad);
  event retirar (address receptor, uint cantidad);
  event prestamo (address prestatario, address prestamista, uint cantidad);
  // Devolucion de prestamo
  event devolver (address prestatario, address prestamista, uint cantidad);

  modifier restricted() {
    require(
      msg.sender == owner,
      "This function is restricted to the contract's owner"
    );
    _;
  }
  constructor()
  {
    owner = msg.sender;
  }
  function Ingresar (uint cantidad) public payable
  {
    require(msg.sender==owner);
    emit ingresar (msg.sender,cantidad);
    cuenta[msg.sender] += cantidad;
  }

  function Retirar (uint cantidad) public
  {
    require(msg.sender==owner);
    require(cuenta[msg.sender] >= cantidad, "Esta retirando una cantidad superior a la que dispone");
    emit retirar(msg.sender, cantidad);
    cuenta[msg.sender] -=  cantidad;
  }

  function Prestamo (address banco, uint cantidad) public payable
  {
    require(msg.sender==owner);
    emit prestamo (msg.sender, banco, cantidad);
    cuenta[msg.sender] += cantidad;
    cuenta[banco] -= cantidad;
  }

  function Devolver (address banco, uint cantidad) public
  {
    //0.1 Eth;  1 eth = 10^8 wei; todos los numeros representados en wei
    uint interes =1 ether/10;
    require(msg.sender==owner);
    require(cuenta[msg.sender]>=(cantidad + interes * cantidad), "No dispone de suficiente fondo para devolver");
    emit devolver(msg.sender, banco, cantidad);
    cuenta[msg.sender] -= (cantidad + interes * cantidad);
    cuenta[banco] += (cantidad + interes * cantidad);
  }
}
